import React, { useEffect, useState } from 'react';

function Resultat() {
  const [activeTab, setActiveTab] = useState('MATCHS');

  useEffect(() => {
    // Effectuer des actions lorsque ce composant est monté ou lorsque les dépendances changent
    console.log('Resultat component mounted or dependencies changed');
  }, []);

  const renderContent = () => {
    switch (activeTab) {
      case 'MATCHS':
        return <div>Contenu des MATCHS</div>;
      case 'CLASSEMENTS':
        return <div>Contenu des CLASSEMENTS</div>;
      case 'STATS':
        return <div>Contenu des STATS</div>;
      default:
        return null;
    }
  };

  return (
    <div>
      {/* Menu avec onglets */}
      <nav>
        <button onClick={() => setActiveTab('MATCHS')}>MATCHS</button>
        <button onClick={() => setActiveTab('CLASSEMENTS')}>CLASSEMENTS</button>
        <button onClick={() => setActiveTab('STATS')}>STATS</button>
      </nav>

      {/* Contenu de la page Resultat */}
      <h1>Resultat Page</h1>
      
      {/* Affichage du contenu en fonction de l'onglet sélectionné */}
      <div>
        {renderContent()}
      </div>
    </div>
  );
}

export default Resultat;
